import { gql } from '@apollo/client'


const signIn = gql`
mutation LoginVendor($loginInput: loginInput) {
    loginVendor(loginInput: $loginInput) {
        vendor {
            token
            phoneNumber
            name
            image
            email
            createdAt
            _id
          }
      message
      code
    }
  }
`

export { signIn }
